import React from 'react';
import { Layout , Breadcrumb , Dropdown , Card , Form , Input  , Button } from 'antd';
import 'antd/dist/antd.css';
import { Typography } from 'antd';
import { Avatar } from 'antd';
import { UserOutlined } from '@ant-design/icons';
import IconImg from '../../assets/icon.png';
import { Menu } from 'antd';
import {Link} from 'react-router-dom';
import { Tabs } from 'antd';
import Sidebarss from './Sidebarss';
const { TabPane } = Tabs;
const { Title } = Typography;
const { Header , Footer, Content  } = Layout;


const ApplyForLicense = () => {
    
    function callback(key) {
        console.log(key);
      }
      const retunrToLoginPage = () =>{
          localStorage.clear();
          window.location = './Login'
      }
      const onFinish = (values) => {
        console.log('Success:', values);
      };
    
      const onFinishFailed = (errorInfo ) => {
        console.log('Failed:', errorInfo);
      };

      const menu = (
                <Menu style={{width: 350 , textAlign : 'center'}}>
                <Menu.Item>
                   <Link>
                  Profile
                  </Link>
                </Menu.Item>
                <Menu.Item>
                <Link>
                   Settings
                   </Link>
                </Menu.Item>
               
                <Menu.Item>
                    <Link onClick={retunrToLoginPage}>
                        <strong>Logout</strong>
                    </Link>
                </Menu.Item>
                </Menu>
            );
                
    return (
        <>
            <Layout >
                <Header style ={{ paddingTop :10  }}>

                <Dropdown overlay={menu} placement="bottomRight" arrow>
                        <Avatar style={{float:'right' , cursor : 'pointer' }} src={IconImg} size="large" icon={<UserOutlined />} />
                </Dropdown>
                        

                <Title level={3} style ={{ color: 'white'}}> <img src='./images/ITP.png' width='30px' alt="logo pic"></img> Islamabad Traffic Police</Title>
                </Header>
            <Layout> 
                                        <Sidebarss />
            <Layout>
                    <Content style={{ padding: '0 50px'}}>
                            <Breadcrumb style={{ margin: '16px 0' }}>
                                <Breadcrumb.Item>Dashboard</Breadcrumb.Item>
                                
                            </Breadcrumb>
                            <div style={{background: '#fff' ,  minHeight : 580 , padding : 24 }} className="site-layout-content">
                            
                                <Content>
                                <Tabs defaultActiveKey="1" onChange={callback}>
                                    <TabPane tab="Apply" key="1">
                                                
                                    <div style={{padding: '30px' ,  background: '#ececec ' , height : '700px' }}>
                                        <Card title="Pay Online Challan " bordered={false} style={{ width: 800  }}>

                                        <Tabs defaultActiveKey="1" onChange={callback}>
                                            <TabPane tab="Using CNIC" key="1">
                                                <Form
                                                name="basic"
                                                labelCol={{ span: 4 }}
                                                wrapperCol={{ span: 16 }}
                                                initialValues={{ remember: true }}
                                                onFinish={onFinish}
                                                onFinishFailed={onFinishFailed}
                                                >
                                                <Form.Item
                                                    label="CNIC"
                                                    name="CNIC"
                                                    
                                                    rules={[{ required: false, message: 'Please input your CNIC!' }]}
                                                >
                                                    <Input type='value'  placeholder='Search CHallan using CNIC' />
                                                </Form.Item>
                                                <Form.Item wrapperCol={{ offset: 4, span: 16 }}>
                                                <Button type="primary" htmlType="submit">
                                                Submit
                                                </Button>
                                            </Form.Item>
                                                </Form>
                                            </TabPane>
                                            <TabPane tab="Using Vehicle Number" key="2">
                                            <Form>
                                            <Form.Item
                                                label="Vehicle Number"
                                                name="Vehicle Number"
                                                rules={[{ required: false, message: 'Please input your Vehicle Number!' }]}
                                            >
                                                <Input type='value'  placeholder='Search CHallan using Vehicle Number' />
                                            </Form.Item>
                                            <Form.Item wrapperCol={{ offset: 4, span: 16 }}>
                                                <Button type="primary" htmlType="submit">
                                                Submit
                                                </Button>
                                            </Form.Item>
                                            </Form>
                                            </TabPane>
                                            
                                        </Tabs>
                                    </Card>
                                    </div>

                                    </TabPane>
                                    <TabPane tab="Applied" key="2">
                                            Applied
                                    </TabPane>
                                    
                                </Tabs>
  
                               

                                </Content>
                            
                            
                            </div>
                    </Content>
                     <Footer>
                        <div className="mfs-auto">
                        <span className="mr-1">Powered by</span>
                        <span> | Islamabad Traffic Police</span>
                    </div>
                    </Footer>
               
                
            </Layout>
            </Layout>
            </Layout>
        </>
    )
}

export default ApplyForLicense
